// client/src/routes/Home.js
import React from 'react';
import { Link } from 'react-router-dom'; // Import Link
import './home.css';

function Home() {
  return (
    <div className='home'>
      <div className='login'>
        <Link to="/login">
          <button>Login</button>
        </Link>
      </div>
      <h1>Welcome to the Home Page</h1>
    </div>
  );
}

export default Home;
